  \"People, Land and History: The Cultural Landscape of the Nulhegan District Cultural
  Resource Assessment and Management Plan of the Former Champion Lands Held in Public
  Ownership\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:25.985881\",\n\t\"name\":
  \"people-land-and-history-the-cultural-landscape-of-the-nulhegan-district-cultural-resource-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a recent study conducted
  by the University of Maine at Farmington Archaeology Research Center on behalf of
  the Vermont Land Trust. Divestment of 132,000 acres of land by Champion Paper Co.
  has placed a substantial tract of land into private and public ownership. This study
  represents a cultural resource assessment and management plan of a 48,000 acre portion
  of the property, which comprises the publicly owned lands. A GIS based sensitivity
  study was undertaken to provide an objective comparison of the project area with
  regard to the potential presence of Native American cultural resources. Historic
  contexts were developed and an inventory of historic Euroamerican resources in the
  area was compiled. The historic Euroamerican aspect of the project included archival
  research, interviews (oral history) and limited field assessment. This study explores
  the relationship of land, people and history and documents the presence and potential
  of the former Champion Lands in reserving an extremely rich cultural landscape,
  both Native American and Euroamerican. The management of cultural resources must
  be integrated with the overall management of the former Champion Lands. With this
  in mind, a plan is presented which focuses on identification, reservation, interpretation
  and public education of cultural resources in the study area.\",\n\t\"license_title\":
